import { useEffect } from 'react';

function HttpRequest(url) {
  useEffect(async () => {
    await fetch(url, {
      method: 'get',
      dataType: 'json',
      headers: { 'Content-Type': 'application/json' },
    })
      .then((result) => result.json())
      .then((result) => result.results)
      .then((result) => result);
  }, [url]);
}
export default HttpRequest;
